import React from "react";
import {
  Route,
  Routes,
} from "react-router-dom";
import Home from "./Home";
import VocabularyPage from "./VocabularyPage";

function RouterContent({CourseList , removeCourse , addCourse, addVocabulary,hiddenVocabulary,removeVocabulary = {removeVocabulary}}) {
    return ( 
        <Routes >
            <Route exact path="/home" element={<Home CourseList = {CourseList} removeCourse = {removeCourse} addCourse = {addCourse} />} />
            {CourseList.map(course => <Route key = {course.id} path={"/home/" + course.name + "/vocabulary"} element={<VocabularyPage key = {course.id} course = {course} addVocabulary = {addVocabulary} hiddenVocabulary = {hiddenVocabulary}/>}/> )}
        </Routes>
    );
}

export default RouterContent;
